import React from "react"
import ContentLoader from "react-content-loader";

const Skeleton = () => (
  <ContentLoader 
    speed={2}
    width={300}
    height={500}
    viewBox="0 0 280 500"
    backgroundColor="#f3f3f3"
    foregroundColor="#ecebeb">
    <circle cx="131" cy="132" r="120" /> 
    <rect x="0" y="287" rx="11" ry="11" width="275" height="32" /> 
    <rect x="0" y="344" rx="11" ry="11" width="280" height="83" /> 
    <rect x="0" y="442" rx="11" ry="11" width="95" height="30" /> 
    <rect x="123" y="442" rx="24" ry="24" width="152" height="45" />
  </ContentLoader>
)

export default Skeleton;
